import React, { Component } from 'react'
import Card from './Card'

export default function Cards (props){
    if (this.props.cities) {
        return (
            <div>
                {this.props.cities.map(c => <Card
                    key={c.id}
                    max={c.temp_max}
                    min={c.temp_min}
                    name={c.name}
                    img={c.img}
                    onClose={this.props.onClose}
                    humidity={c.humidity}
                    id={c.id}
                />)}
            </div>
        );
    } else {
        return (
            <div>No cities found</div>
        )
    }
};
